import './homePage.css';
import Nav from '../components/nav.js';
import PopularRecipies from '../components/popularRecipies.js';
import PopularCategories from '../components/popularCatagories.js';
import WhatToCockToday from '../components/whatToCockToday.js';
import AboutUs from '../components/AboutUs.js';
import OurCommunity from '../components/ReadyToCock.js'
import Footer from '../components/footer.js';
import { useEffect , useRef } from 'react';

function App() {
  useEffect(() => {
    window.scrollTo(0, 0)
  }, [])
  const handleScrollToComponentB = () => {
    componentBRef.current.scrollIntoView({ behavior: "smooth" });
  };
  return (
    
    <div className="App  overflow-hidden ">
      <Nav onScrollToComponentB={handleScrollToComponentB}   />
      <PopularRecipies />
      <PopularCategories/>
      <WhatToCockToday/>
      <AboutUs ref={componentBRef}/>
      <OurCommunity/>
      <Footer/>
    </div>

  );
}

export default App;
